Scala’s solution to this problem is to use a trio of classes known as Option, Some, and None. The Some and None classes are subclasses of Option, so the solution works like this: You declare that toInt returns an Option type If toInt receives a string it can convert to an Int, you wrap the Int inside of a Some If toInt receives a string it can’t convert, it returns a None The implementation of the solution looks like this: def toInt(s: String): Option[Int] = { try { Some(Integer.parseInt(s.trim)) } catch { case e: Exception => None }
} This code can be read as, “When the given string converts to an integer, return the integer wrapped in a Some wrapper, such as Some(1). When the string can’t be converted to an integer, return a None value.” Here are two REPL examples that demonstrate toInt in action: scala> val a = toInt("1")
a: Option[Int] = Some(1) scala> val a = toInt("foo")
a: Option[Int] = None As shown, the string "1" converts to Some(1), and the string "foo" converts to None. This is the essence of the Option/Some/None approach. It’s used to handle exceptions (as in this example), and the same technique works for handling null values. You’ll find this approach used throughout Scala library classes, and in third-party Scala libraries.

