Because Some and None can be thought of containers, they can be further thought of as being like collections classes. As a result, they have all of the methods you’d expect from a collection class, including map, filter, foreach, etc. This raises an interesting question: What will these two values print, if anything? toInt("1").foreach(println)
toInt("x").foreach(println) The answer is that the first example prints the number 1, and the second example doesn’t print anything. The first example prints 1 because: toInt("1") evaluates to Some(1) The expression evaluates to Some(1).foreach(println) The foreach method on the Some class knows how to reach inside the Some container and extract the value (1) that’s inside it, so it passes that value to println Similarly, the second example prints nothing because: toInt("x") evaluates to None The foreach method on the None class knows that None doesn’t contain anything, so it does nothing Again, None is just an empty container. Somewhere in Scala’s history, someone noted that the first example (the Some) represents the “Happy Path” of Option/Some/None approach, and the second example (the None) represents the “Unhappy Path.” But , despite having two different possible outcomes, the cool thing about the approach is that the code you write to handle an Option looks exactly the same in both cases. The foreach examples look like this: toInt("1").foreach(println)
toInt("x").foreach(println) And the for-expression looks like this: val y = for { a <- toInt(stringA) b <- toInt(stringB) c <- toInt(stringC)
} yield a + b + c You only have to write one piece of code to handle both the Happy and Unhappy Paths, and that simplifies your code. The only time you have to think about whether you got a Some or a None is when you finally handle the result value in a match expression, like this: toInt(x) match { case Some(i) => println(i) case None => println("That didn't work.")
}

