} Scala doesn’t require you to use parentheses in the if expressions, but you can use them if you think that makes them more readable: count match { case 1 => println("one, a lonely number") case x if (x == 2 || x == 3) => println("two's company, three's a crowd") case x if (x > 3) => println("4+, that's a party") case _ => println("i'm guessing your number is zero or less")
} You can also write the code on the right side of the => on multiple lines if you think is easier to read. Here’s one example: count match { case 1 => println("one, a lonely number") case x if x == 2 || x == 3 => println("two's company, three's a crowd") case x if x > 3 => println("4+, that's a party") case _ => println("i'm guessing your number is zero or less")
} Here’s a variation of that example that uses curly braces: count match { case 1 => { println("one, a lonely number") } case x if x == 2 || x == 3 => { println("two's company, three's a crowd") } case x if x > 3 => { println("4+, that's a party") } case _ => { println("i'm guessing your number is zero or less") }
} Here are a few other examples of how you can use if expressions in case statements. First, another example of how to match ranges of numbers: i match { case a if 0 to 9 contains a => println("0-9 range: " + a) case b if 10 to 19 contains b => println("10-19 range: " + b) case c if 20 to 29 contains c => println("20-29 range: " + c) case _ => println("Hmmm...")
} Lastly, this example shows how to reference class fields in if expressions: stock match { case x if (x.symbol == "XYZ" && x.price < 20) => buy(x) case x if (x.symbol == "XYZ" && x.price > 50) => sell(x) case x => doNothing(x)
}

