Scala has a match expression, which in its most basic use is like a Java switch statement: val result = i match { case 1 => "one" case 2 => "two" case _ => "not 1 or 2"
} The match expression isn’t limited to just integers, it can be used with any data type, including booleans: val booleanAsString = bool match { case true => "true" case false => "false"
} Here’s an example of match being used as the body of a method, and matching against many different types: def getClassAsString(x: Any):String = x match { case s: String => s + " is a String" case i: Int => "Int" case f: Float => "Float" case l: List[_] => "List" case p: Person => "Person" case _ => "Unknown"
} Powerful match expressions are a big feature of Scala, and we share more examples of it later in this book.

