As an example to get us started, imagine that you want to write some code to model animals like dogs and cats, any animal that has a tail. In Scala you write a trait to start that modeling process like this: trait TailWagger { def startTail(): Unit def stopTail(): Unit
} That code declares a trait named TailWagger that states that any class that extends TailWagger should implement startTail and stopTail methods. Both of those methods take no input parameters and have no return value. This code is equivalent to this Java interface: public interface TailWagger { public void startTail(); public void stopTail();
}

